import React from "react";
import Brightness5Icon from "@material-ui/icons/Brightness5";

function Header() {
  return (
    <header>
      <h1>
        <Brightness5Icon />
        Keeper
        <span>       </span>
        <span className="headerSpan">The right place to keep note</span>
      </h1>
    </header>
  );
}

export default Header;
